import React, {useState } from 'react'
import { useNavigate } from "react-router-dom";
import {Avatar} from '@mui/material'

const Navbar = ({isLoggedin, user}) => {

  // const [open, setOpen] = useState(false);
  const [dropdownOpen, setDropdownOpen] = useState(false);
  const[navbarToggle, setNabvarToggle] = useState(false)

  const [isOpen, setIsOpen] = useState(false);
  const genericHamburgerLine = `h-1 w-6 my-1 rounded-full bg-black transition ease transform duration-300`;
  const navigate = useNavigate()
  const handleLoginNavigate=(e)=>{
    e.preventDefault()
    navigate('/login')
  }

  const avatar = isLoggedin ? <Avatar>user.username</Avatar> : <button onClick={handleLoginNavigate} className='bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded'>Login/Signup</button>


  return (
    <div className='w-full text-gray-700 bg-transparent dark-mode:text-gray-200 dark-mode:bg-gray-800'>
      {/*   ORIGINAL CODE  <div className='flex flex-col max-w-screen-xl px-4 mx-auto md:items-center md:justify-between md:flex-row md:px-6 lg:px-8'> */}
      <div className='flex max-w-screen-xl px-4 mx-auto items-center justify-between flex-row md:px-6 lg:px-8'>
        <a href='/' className='text-lg font-semibold tracking-widest text-gray-900 uppercase rounded-lg dark-mode:text-white focus:outline-none focus:shadow-outline'>
          App LOGO
        </a>
        {/* The Hanmburger Icon */}
        <button className="flex flex-col h-12 w-12 border-2 border-black rounded justify-center items-center group md:hidden rounded-lg focus:outline-none focus:shadow-outline" onClick={() => setIsOpen(!isOpen)}>
          <div className={`${genericHamburgerLine} ${isOpen ? "rotate-45 translate-y-3 opacity-50 group-hover:opacity-100": "opacity-50 group-hover:opacity-100"}`}/>
          <div className={`${genericHamburgerLine} ${isOpen ? "opacity-0" : "opacity-50 group-hover:opacity-100"}`}/>
          <div className={`${genericHamburgerLine} ${isOpen ? "-rotate-45 -translate-y-3 opacity-50 group-hover:opacity-100": "opacity-50 group-hover:opacity-100"}`}/>
        </button>


      </div>
    </div>
  )


}

export default Navbar








